"""
Unit tests for add function
"""

from unittest import TestCase, main

from add import add

KEY_TEXT = "ssh-rsa  schacon@mylaptop.local"


class TestAdd(TestCase):
    """
    Unit tests for add function
    """

    def setUp(self):
        self._key = KEY_TEXT

    def test_add(self):
        add(self._key)

    def test_doubling_key(self):
        add(self._key)
        add(self._key)


if __name__ == "__main__":
    main()
